import React from "react";

function Movie({ title, poster }) {
  return (
    <div>
      <h1>I like {title}</h1>
      <img src={poster} />
    </div>
  );
}

const movieILike = [
  {
    title: "아이언맨",
    poster:
      "https://lh3.googleusercontent.com/proxy/Olerh3uViPkzvq1ZAyulnfwOvghguLe0HodyaswVvOdu1OTCDeeGvqxLb-RDL0EYILcB96TdVjn6KbbcGu17agb91GcqBx5CJxsQbjz5CZ1I9t1cZcMxgn1Rux5ojRMI3pAmkphUS37LRcnWGYn00OjGPtMT5tw6LDcu8eIhAiRDmRSIRejdDejTTgT1WC9ux5YAakaPjinrI85jdsbcCBd1YoYHbs7O0YFh2_96gXYq8Cm4HGOHGV0dleA-yHIoSp9gm4Gnz5ygrY8r9Pgl8BuecgeGb0n7J4IQadzi0v-EJO7SeMR6-KutobPxfbrLGY2ua2_gOsO8",
  },
  {
    title: "토르",
    poster:
      "data:image/jpeg;base64,",
  },
  {
    title: "퍼스트 어벤저",
    poster:
      "https://upload.wikimedia.org/wikipedia/ko/6/60/%ED%8D%BC%EC%8A%A4%ED%8A%B8_%EC%96%B4%EB%B2%A4%EC%A0%B8.jpg",
  },
  {
    title: "헐크",
    poster:
      "https://img1.daumcdn.net/thumb/R800x0/?scode=mtistory2&fname=https%3A%2F%2Ft1.daumcdn.net%2Fcfile%2Ftistory%2F24464441588290B531",
  },
];

function renderMovie(like) {
  console.log(like);
  return <Movie title={like.title} poster={like.poster} />;
}

function App() {
  return <div>{movieILike.map(renderMovie)}</div>;
}

export default App;
